// import React from 'react';
import { count } from 'console';
import React, { useEffect, useState } from 'react';
import './App.css';




// type SetStateNumberType = (arg1: number) => void
type SetStateNumberType = React.Dispatch<React.SetStateAction<number>>
type UseCountLimitReturn = [number, SetStateNumberType]

function useCountWithLimit (limit: number) : UseCountLimitReturn {
  const [count,setCount] = useState(0)

  let value = count
  if(count > limit) {
    value = limit
  }
  return [value, setCount]
}


function InputComponent() {
  const [name, setName] = useState('')
  const [lastName, setLastName] = useState('')
  const [fullName, setFullName] = useState('')


  useEffect(() => {
    console.log('useEffect render')
  }, [])

  useEffect(() => {
    console.log('useEffect name')
    let a = name.toUpperCase() + lastName.toUpperCase()
    setFullName(a)
  }, [name, lastName])

  return <>
  <input onChange={(e) => setName(e.target.value)}/>
  <input onChange={(e) => setLastName(e.target.value)}/>
  <div>Entered: {fullName}</div>
  </>
}


function Canvas() {
  const [coord, setCoord] = useState({x: NaN, y: NaN})

  function tracking(x: number, y:number) {
    setCoord({x, y})
  }

  return <><div
  className='myCanvas'
  onMouseEnter={(e) => tracking(e.clientX, e.clientY)}
  onMouseLeave={() => console.log({x:NaN, y:NaN})}
  onMouseMove={(e) => tracking(e.clientX, e.clientY)}
  >
  </div>
  <div>X: {coord.x}</div>
  <div>Y: {coord.y}</div>
  </>

}


// const [value:count1, setCount:setCount1] = noLimits(100);
// const [value:count2, setCount:setCount2] = noLimits(100);

function CounterComponent2() {
  const [count1, setCount1] = useState(0);
  const [count2, setCount2] = useState(1);
  const [counters, setCounters] = useState( {counter1: 0, counter2: 0} )
  const [letter, setLetter] = useState('sdcds');


  function handler0() {
    setCounters({
      counter1:counters.counter1 + 1,
      counter2:counters.counter2,
    })
  }

  function handler00() {
    setCounters({
      counter1:counters.counter1,
      counter2:counters.counter2 - 1,
    })
  }

  function handler1() {
    setCount1(count1 + 2)
    setCount2(count2 * 2)
  }

  function handler2() {
    setCount1(count1 - 2)
    setCount2(count2 / 2)
  }

  function clear() {
    setCount1(0)
    setCount2(1)
  }
  useEffect(() => {
    console.log('useEffect count')
    let b = letter.toUpperCase()
    setLetter(b)
  }, [count1, count2])

  return (
    <div className='wrapperDiv'>
      <p>ans: {letter}</p>
    <button onClick = {handler1}>
      btn plus
    </button>
    <p>11 counter: <span>{count1}</span></p>

    <button onClick = {handler2}>
      btn minus
    </button>
    <p>22 counter: <span>{count2}</span></p>

    <button onClick = {clear}>
      clear
    </button>

    <button onClick = {handler0}>
      test
    </button>
    <p>test: <span>{counters.counter1}</span></p>

    <button onClick = {handler00}>
      test2
    </button>
    <p>test: <span>{counters.counter2}</span></p>
      </div>
  )
}


function CounterComponent1() {
  const [count, setCount] = useState( {counter1: 0, counter2: 0} )
  return (
    <div className='wrapperDiv'>
    <button onClick = {() => setCount(a => {
      return {
      ...a,
      counter1: a.counter1 + 1
    }
    })}>
      btn 1
    </button>
    <p>1 counter: <span>{count.counter1}</span></p>
    <button onClick = {() => setCount(a =>({
      ...a,
      counter2: a.counter2 + 1
    }))}>
      btn 2
    </button>
    <p>2 counter: <span>{count.counter2}</span></p>
      </div>
  )
}


const obj: {name:string; year:string} = {
  name:'Lesson',
  year:'2025',
}

function Inner(props: { year: string} ) {
  return (
    <div>
      <h2>date start {props.year}</h2>
    </div>
  )
}

function Test(props: { name: string; year: string}) {
  return (
    <div>
      <h1>start project {props.name}</h1>
      <Inner year = {props.year}/>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Test {...obj}/>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          Edit <code>src/App.js</code> HELLO
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Canvas/>
        <CounterComponent1/>
        <CounterComponent2/>
        <InputComponent/>

      </header>
    </div>
  );
}

export default App;
